    const [tasks, setTasks] = useState(initialState);
    return (
        <div>
            {tasks.map((task) => (
                // <h3 key={task.id}>{task.text}</h3>
                <Task key={task.id} task={task} />
            ))}
        </div>
    )
}

export default Tasks
